import React from "react";

function CreateAreaPeriod() {
  return (
    <div className="create-period">
      <input id="daily" type="radio" name="period" onChange={handleChange} />
      <label htmlFor="daily">Daily</label>
      <input
        id="weekly"
        type="radio"
        name="period"
        checked={true}
        onChange={handleChange}
      />
      <label htmlFor="weekly">Weekly</label>
      <input id="monthly" type="radio" name="period" onChange={handleChange} />
      <label htmlFor="monthly">Monthly</label>
      <input id="yearly" type="radio" name="period" onChange={handleChange} />
      <label htmlFor="yearly">Yearly</label>
    </div>
  );
}

export default CreateAreaPeriod;
